import React from 'react';
import { Link } from 'react-router-dom';

export const Dashboard = () => {

    return(

        <>

        <Link tp="/">Dashboard</Link> <br />
        <Link tp="/listar">Listar</Link> <br />
        
        <h1>Willcome - Dashboard</h1>
        </>

    );
}
